    "2016-07-13T18:46:20.928329",nt"name": "regional-innovation-clusters",nt"isopen":
    true,nt"url": null,nt"notes": "The Regional Innovation Clusters serve a
    diverse group of sectors and geographies. Three of the initial pilot clusters, termed
    Advanced Defense Technology clusters, are specifically focused on meeting the needs
    of the defense industry. The Wood Products Cluster, debuted in 2015, supports the
    White Houseu2019s Partnerships for Opportunity and Workforce and Economic Revitalization
    (POWER) Initiative for coal communities. All of the clusters support small businesses
    by fostering a synergistic network of small and large businesses, university researchers,
    regional economic organizations, stakeholders, and investors, while providing matchmaking,
    business training, counseling, mentoring, and other services to help small businesses
    expand and grow.",nt"license_title": "U.S. Government Work",nt"extras":
